(ns advent-of-code-2018.day-five
  (:require [clojure.pprint :as pp]
            [clojure.string :as cs]))

(def small-input "dabAcCaCBAcCcaDA")

(defn react-pair
  [pair]
  (let [a (first pair)
        b (last pair)]
    (if (and (.equalsIgnoreCase (str a) (str b)) (not (.equals (str a) (str b))))
      ()
      pair)))

(defn react-and-flatten
  [pairs]
  (flatten (remove empty? (map react-pair pairs))))

(defn react-once
  [input]
  (let [char-seq (seq input)
        even-pairs (partition 2 char-seq)
        even-reacted (react-and-flatten even-pairs)
        odd-pairs (partition 2 (rest even-reacted))
        odd-reacted (react-and-flatten odd-pairs)
        output (cons (first even-reacted) (concat odd-reacted (seq [(last even-reacted)])))]
    (cs/join output)))

(defn react
  [input]
  (loop [in input]
    (let [result (react-once in)
          input-size (count in)
          result-size (count result)]
      (if (= input-size result-size)
        result
        (recur result)))))

(defn remove-and-react-one
  [input char-to-remove]
  (let [char (str char-to-remove)
        upper-char (.toUpperCase char)
        clean-string (cs/replace (cs/replace input char "") upper-char "")]
    (react clean-string)))

(defn calc-count
  [result-string]
  (let [count (count result-string)]
    {:count count :reaction result-string}))

(defn remove-and-react
  [input]
  (let [replacements "abcdefghijklmnopqrstuvwxyz"
        replace-seq (seq replacements)
        reacted-strings (map #(partial (remove-and-react-one input %)) replace-seq)]
    (map calc-count reacted-strings)))

